CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_generar_personas_aleatorias`(IN cantidad INT)
BEGIN
  DECLARE contador INT DEFAULT 0;
  DECLARE nombres VARCHAR(50);
  DECLARE apellidos VARCHAR(50);
  DECLARE correo VARCHAR(100);
  DECLARE contrasena VARCHAR(20);
  DECLARE genero ENUM('Hombre', 'Mujer');
  DECLARE fecha_nacimiento DATE;
  DECLARE estatus ENUM('Activo', 'Inactivo');
  DECLARE fecha_registro TIMESTAMP;
  DECLARE fecha_actualizacion TIMESTAMP;

  WHILE contador < cantidad DO
    -- Generar nombres aleatorios (puedes tener una lista de nombres en otra tabla)
    SET nombres = (SELECT nombre FROM nombres_aleatorios ORDER BY RAND() LIMIT 1);

    -- Generar apellidos aleatorios (puedes tener una lista de apellidos en otra tabla)
    SET apellidos = (SELECT apellido FROM apellidos_aleatorios ORDER BY RAND() LIMIT 1);

    -- Generar correo aleatorio
     SET correo = CONCAT(LOWER(REPLACE(nombres, ' ', '')), '.', LOWER(REPLACE(apellidos, ' ', '')), '@gmail.com');

    -- Generar contraseña aleatoria (puedes adaptar esto según tus requisitos)
    SET contrasena = CONCAT(LEFT(UUID(), 8), '!', FLOOR(RAND()*100));

    -- Generar género aleatorio 
    SET genero = IF(RAND() < 0.5, 'Hombre', 'Mujer');

    -- Generar fecha de nacimiento aleatoria entre 1950-01-01 y 2005-12-31
    SET fecha_nacimiento = DATE_ADD('1950-01-01', INTERVAL FLOOR(RAND() * 20000) DAY);

    -- Generar estatus aleatorio ('Activo' o 'Inactivo')
    SET estatus = IF(RAND() > 0.5, 'Activo', 'Inactivo');

    -- Generar fecha de registro aleatoria (entre ahora y hace 10 años)
    SET fecha_registro = DATE_SUB(NOW(), INTERVAL FLOOR(RAND() * 3650) DAY);

    -- Generar fecha de actualización aleatoria (entre ahora y hace 5 años)
    SET fecha_actualizacion = DATE_SUB(NOW(), INTERVAL FLOOR(RAND() * 1825) DAY);

    -- Insertar la persona generada en la tabla
    INSERT INTO tbb_persona (nombre, apellido, correo, contrasena, genero, fecha_nacimiento, estatus, fecha_registro, fecha_actualizacion)
    VALUES (nombres, apellidos, correo, contrasena, genero, fecha_nacimiento, estatus, fecha_registro, fecha_actualizacion);

    SET contador = contador + 1;
  END WHILE;
END ;;
DELIMITER ;
